var resetForm=function resetForm(g){stopPropagation(g);document.getElementById("file-form")["reset"]();var f=document.getElementById("file-disclaimer");if(f!==null){if(f.className===""){f.className="hidden"}}var c=document.getElementById("file-error");var b=document.getElementById("file-info");if(c!==null&&c.className===""){c.className="hidden"}if(b!==null&&b.className===""){b.className="hidden"}var a=document.getElementById("file-icon");a.className="fa fa-angle-double-up";var d=g.target;d.checked=true};var readFile=function readFile(h){stopPropagation(h);var i=h.target;if(i.files&&i.files.length>0){var g=i.files[0];var j=document.getElementById("file-icon");var b=document.querySelector('input[type="radio"]:checked')["value"];var l="";if(b==="shp"&&g.type==="application/zip"){l="fa fa-file-archive-o"}else{if(b==="kml"&&g.type==="application/vnd.google-earth.kml+xml"){l="fa fa-file-text-o"}else{if(b==="geojson"&&g.type==="application/json"){l="fa fa-file-code-o"}else{if(b==="csv"&&g.type==="text/csv"){l="fa fa-file-excel-o"}else{l="fa fa-close"}}}}j.className=l;var d=document.getElementById("file-disclaimer");if(d!==null){if(d.className==="hidden"){d.className=""}}var a=document.getElementById("file-error");var f=document.getElementById("file-info");if(l==="fa fa-close"){if(a!==null&&a.className==="hidden"){a.className=""}if(f!==null&&f.className===""){f.className="hidden"}}else{if(a!==null&&a.className===""){a.className="hidden"}if(f!==null){if(f.className==="hidden"){f.className=""}var c=g.name;var k=c.split(".").pop();if(c.length>21){c=c.slice(0,21-k.length)+" ..."+k}f.innerHTML=c}}}};ready(function(){var b=document.getElementById("file-chooser");if(b!==null){addListener(b,"change",readFile)}var c=document.getElementsByClassName("file-radio");if(c!==null){for(var a=0;a<c.length;a++){addListener(c[a],"change",resetForm)}}});